import "./App.css";
import Header from "./components/Header";
import Nav from "./components/Nav";


function App() {
  return (
    <div className="App">
      <Header/>
        <Nav/>
        <main className="content">
          <img src="https://hips.hearstapps.com/hmg-prod/images/champagne-beach-espiritu-santo-island-vanuatu-royalty-free-image-1655672510.jpg?crop=1.00xw:0.755xh;0,0.173xh&resize=1200:*" alt="" />
              <div> Avatar</div>
              <div> My post </div>
              <div> New Post </div>
              <div> Post 1 </div>
              <div> Post 2 </div>
          </main>
    </div>  
  );
}

export default App;
